import { Injectable } from '@angular/core';
import { FormGroup, FormControl, Validators } from '@angular/forms';
import { PasswordsForm, LoginForm, RegisterForm, PasswdRecoveryForm } from '../models/form.model';
import { equivalentValidator } from '../validators/equivalent.validator';

@Injectable({
  providedIn: 'root',
})
export class FormService {
  initPasswordsForm(): FormGroup<PasswordsForm> {
    return new FormGroup(
      {
        password: new FormControl('', {
          validators: [Validators.required, Validators.minLength(8), Validators.maxLength(75)],
          nonNullable: true,
        }),
        repeatedPassword: new FormControl('', {
          validators: [Validators.required, Validators.minLength(8), Validators.maxLength(75)],
          nonNullable: true,
        }),
      },
      { validators: [equivalentValidator('password', 'repeatedPassword')] }
    );
  }

  initLoginForm(): FormGroup<LoginForm> {
    return new FormGroup({
      email: new FormControl('', {
        validators: [
          Validators.required,
          Validators.email,
          Validators.minLength(3),
          Validators.maxLength(50),
        ],
        nonNullable: true,
      }),
      password: new FormControl('', {
        validators: [Validators.required, Validators.minLength(8), Validators.maxLength(75)],
        nonNullable: true,
      }),
    });
  }

  initRegisterForm(): FormGroup<RegisterForm> {
    return new FormGroup({
      name: new FormControl('', {
        validators: [Validators.required, Validators.minLength(3), Validators.maxLength(50)],
        nonNullable: true,
      }),
      email: new FormControl('', {
        validators: [Validators.required, Validators.minLength(3), Validators.maxLength(50)],
        nonNullable: true,
      }),
      password: new FormControl('', {
        validators: [Validators.required, Validators.minLength(8), Validators.maxLength(75)],
        nonNullable: true,
      }),
      repeatedPassword: new FormControl('', {
        validators: [Validators.required, Validators.minLength(8), Validators.maxLength(75)],
        nonNullable: true,
      }),
    });
  }

  initPasswdRecoveryForm(): FormGroup<PasswdRecoveryForm> {
    return new FormGroup({
      email: new FormControl('', {
        validators: [Validators.required, Validators.email],
        nonNullable: true,
      }),
    });
  }

  getErrorMessage(control: FormControl): string {
    if (control.hasError('required')) {
      return 'Ta kontrolka jest wymagana.';
    }

    if (
      control.hasError('pattern') &&
      control.errors?.['pattern']?.['requiredPattern'] === '/^\\d{2}-\\d{3}$/'
    ) {
      return 'Podano kod pocztowy w niepoprawnym formacie.';
    }

    if (control.hasError('minlength')) {
      return `Minimalna ilo znakw: ${control.errors?.['minlength']?.requiredLength}.`;
    }

    if (control.hasError('maxlength')) {
      return `Maksymalna ilo znakw: ${control.errors?.['maxlength']?.requiredLength}.`;
    }

    if (control.hasError('email')) {
      return `Niepoprawny adres e-mail.`;
    }

    if (control.hasError('passwordsNotEqual')) {
      return 'Hasa musz by takie same.';
    }

    return '';
  }
}

import { Injectable } from '@angular/core';
import { MessageService } from 'primeng/api';
import type { Keys, Severity } from '../types/toast.types';

@Injectable({
  providedIn: 'root',
})
export class ToastService {
  constructor(private messageService: MessageService) {}

  show(severity: Severity, summary: string, detail: string, key?: Keys, life?: number) {
    this.messageService.add({
      severity,
      summary,
      detail,
      key,
      life,
    });
  }

  showSuccess(summary: string, detail: string, key?: Keys, life?: number) {
    this.show('success', summary, detail, key, life);
  }

  showInfo(summary: string, detail: string, key?: Keys, life?: number) {
    this.show('info', summary, detail, key, life);
  }

  showWarning(summary: string, detail: string, key?: Keys, life?: number) {
    this.show('warn', summary, detail, key, life);
  }

  showError(summary: string, detail: string, key?: Keys, life?: number) {
    this.show('error', summary, detail, key, life);
  }

  clear(key?: string) {
    this.messageService.clear(key);
  }
}

